import React, {Component} from 'react';
import {Col, Container, Row} from "react-bootstrap";

class Layout extends Component {
    render() {
        return (
            <div className="Layout">
                <Container fluid>
                    <Row>
                        <Col md={6}>
                            <h1>Col1</h1>
                        </Col>
                        <Col md={6}>
                            <h1>Col2</h1>
                        </Col>
                    </Row>
                </Container>
            </div>
        );
    }
}

export default Layout;
